import React, { Component } from "react";
import { BrowserRouter, Switch, Route, Router } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Router></Router>
      <h1>Our app</h1>
    </div>
  );
}

export default App;
